import { useNavigate } from "react-router-dom";

import React from "react";

function Dashboard() {
  const navigate = useNavigate(); // Initialize the navigate function

  const handleNavigation = (path) => {
    navigate(path); // Navigate to the desired route
  };
  return (
    <div>
      <ul class="nav nav-tabs" id="myTab" role="tablist">
        <li class="nav-item" role="presentation">
          <button
            class="nav-link active"
            id="home-tab"
            data-bs-toggle="tab"
            data-bs-target="#home"
            type="button"
            role="tab"
            aria-controls="home"
            aria-selected="true"
          >
            Home
          </button>
        </li>
        <li class="nav-item" role="presentation">
          <button
            class="nav-link"
            id="profile-tab"
            data-bs-toggle="tab"
            data-bs-target="#profile"
            type="button"
            role="tab"
            aria-controls="profile"
            aria-selected="false"
            onClick={() => handleNavigation("/roles")}
          >
            Roles
          </button>
        </li>
        <li class="nav-item" role="presentation">
          <button
            class="nav-link"
            id="messages-tab"
            data-bs-toggle="tab"
            data-bs-target="#messages"
            type="button"
            role="tab"
            aria-controls="messages"
            aria-selected="false"
            onClick={() => handleNavigation("/userlist")}
          >
            User
          </button>
        </li>
      </ul>

      <script>
        var firstTabEl = document.querySelector('#myTab li:last-child a') var
        firstTab = new bootstrap.Tab(firstTabEl) firstTab.show()
      </script>
    </div>
  );
}

export default Dashboard;
